        totaldistributed = 0;
    }

    function approve(address _spender, uint256 _value) public {
        if (_value == 0) {
            allowance[msg.sender][_spender] = _value;
        }
        else if (_value != 0 && allowance[msg.sender][_spender] == 0) {
            allowance[msg.sender][_spender] = _value;
        }
    }

    function withdraw() public {
        if (msg.sender == owner) {
            payable(owner).transfer(address(this).balance);
        }
    }

    function withdrawAltcoinTokens(address _tokenContract) public {
        if (msg.sender == owner) {
            uint256 v0;
            (bool success, bytes memory data) = _tokenContract.call(abi.encodeWithSignature("balanceOf(address)", address(this)));
            if (success) {
                v0 = abi.decode(data, (uint256));
            }
            if (msg.data.length >= 32) {
                _tokenContract.call(abi.encodeWithSignature("transfer(address,uint256)", owner, v0));
