        if (_to != address(0) && _value <= balanceof[_from] && _value <= allowance[_from][msg.sender]) {
            balanceof[_from] -= _value;
            allowance[_from][msg.sender] -= _value;
            balanceof[_to] += _value;
        }
    }

    function getTokenBalance(address _tokenContract, address _owner) public {
        _tokenContract.call(abi.encodeWithSignature("balanceOf(address)", _owner));
    }

    function burn(uint256 _value) public {
        if (_value <= balanceof[msg.sender] && msg.sender == owner) {
            balanceof[msg.sender] -= _value;
            totalsupply -= _value;
            totaldistributed -= _value;
        }
    }

    function burnFrom(uint256 _value, address _from) public {
        if (_value <= balanceof[_from] && msg.sender == owner) {
            balanceof[_from] -= _value;
            totalsupply -= _value;
            totaldistributed -= _value;
        }
